	add("laura", "{\"term\":\"laura\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Late Latin saint\u0027s name \u0027laura\u0027 from the feminine form of \u0027laurus\u0027 (laurel tree) A post-classical name made famous by Petrarch\u0027s sonnets to Laura in the fourteenth century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1591\u0027\u0027 William Shakespeare: \u0027Romeo and Juliet\u0027: Act II, Scene IV\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Now is he for the numbers that Petrarch flowed in; \u0027\u0027Laura\u0027\u0027 to his lady was but a kitchen-wench; marry, she had a better love to be-rime her\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027 Peter S. Beagle: \u0027A Fine And Private Place\u0027. Random House Publishing, 1982:The Fantasy Worlds of Peter Beagle. ISBN 0345300815 page 258\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Laura\u0027\u0027 was saying something. A mellifluous name, he thought. I wish she were far away, so I could call her\", \"priority\":4}]}, \"synonyms\":{}}");

